        }
    }*/

    function _return(bool result_) internal view virtual {
        assembly {
            returndatacopy(0, 0, returndatasize())
            switch result_
            case 0 {
                revert(0, returndatasize())
            }
            default {
                return(0, returndatasize())
            }
        }
    }

    fallback() external virtual onlyContractsOrOperators {
        bytes memory bys = msg.data[4:36];
        address _implementation;
        assembly {
            _implementation := mload(add(bys, 32))
        }
        //address _implementation = bytesToAddress(msg.data[4:36]);

        bool _result;
        assembly {
            let newargumentsize := sub(calldatasize(), 36)
            let newcalldatasize := add(newargumentsize, 4)

            calldatacopy(0, 0, 4)
            calldatacopy(4, 36, newargumentsize)

            // Call the implementation.
            // out and outsize are 0 because we don't know the size yet.
            _result := delegatecall(
                gas(),
                _implementation,
                0,
                newcalldatasize,
                0,
                0
            )
        }
        _return(_result);
    }
